INSERT INTO `cuahang` (`id`, `name`, `content`, `datetime`, `type`) VALUES
(3, 'Giới thiệu về Cửa hàng Thành công', '                                                                                        <div class=\"hometext margin-bottom-lg\" style=\"box-sizing: border-box; margin-bottom: 15px; font-weight: 700; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;\"=\"\">Ván ép Nhật Nam chuyên cung cấp các sản phẩm ván ép gỗ lạng, ván ép uốn cong, ván ép định hình, ván ép thẳng như ván ép ghế, tay chân ghế, vạt giường, hộc tủ...</div><div class=\"clear\" style=\"box-sizing: border-box; clear: both; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;\"=\"\"></div><div id=\"page-bodyhtml\" class=\"bodytext margin-bottom-lg\" style=\"box-sizing: border-box; margin-bottom: 15px; word-break: keep-all; max-width: 100%; overflow-x: hidden; overflow-y: visible; line-height: 1.7em; color: rgb(51, 51, 51); font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;\"=\"\"><div style=\"box-sizing: border-box; text-align: center;\"><h2 style=\"box-sizing: border-box; font-family: inherit; font-weight: 700; line-height: 1.5; margin: 0px; font-size: 16px; padding: 0px; text-align: justify;\">Ván ép Nhật Nam</h2><div style=\"box-sizing: border-box; text-align: justify;\">Bằng công nghệ sản xuất<strong style=\"box-sizing: border-box; font-weight: bold;\">&nbsp;ván ép uốn cong (ván ép đinh hình)</strong>, các sản phẩm của&nbsp;<strong style=\"box-sizing: border-box; font-weight: bold;\">ván ép&nbsp;</strong>Nhật Nam đã đáp ứng được những yêu cầu khó nhất trong ngành sản xuất nội thất gỗ:</div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\">TẦM NHÌN: Công ty&nbsp;</span><strong style=\"box-sizing: border-box; font-weight: bold; color: rgb(0, 0, 0);\">ván ép</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;Nhật Nam&nbsp;là nhà cung cấp ván ép uốn cong (ván ép định hình) hàng đầu tại VIỆT NAM vào năm 2016.</span><br></div><figure class=\"image\" style=\"box-sizing: border-box; margin-right: 10px; margin-bottom: 10px; position: relative; padding: 3px; float: right;\"><img alt=\"ván ép Nhật Nam\" height=\"530\" src=\"http://vanepnhatnam.com/uploads/about/van-ep-nhat-nam_1.jpg\" width=\"1000\" style=\"box-sizing: border-box; border: 0px; margin-right: 5px; width: 700px; height: 371px;\"><figcaption style=\"box-sizing: border-box; margin-top: 5px; font-size: 12px;\"><em style=\"box-sizing: border-box;\">Công ty TNHH Ván ép - cơ khí - xây dựng Nhật Nam</em></figcaption></figure></div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: justify;\"><br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp;</p><div style=\"box-sizing: border-box; text-align: justify;\"><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">&nbsp;<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp;</span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br style=\"box-sizing: border-box;\">&nbsp; </span></div><div style=\"box-sizing: border-box; text-align: justify;\"><br></div><div style=\"box-sizing: border-box; text-align: justify;\"><br></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br></span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br></span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br></span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br></span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br></span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br></span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br></span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br></span></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"color: rgb(0, 0, 0);\">SỨ MẠNG: Công ty ván ép Nhật Nam&nbsp;là nhà cung cấp ván ép uốn cong chất lượng với dịch vụ tốt nhất.</span><br></div><div style=\"box-sizing: border-box; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><br style=\"box-sizing: border-box;\">&nbsp; CHIẾN LƯỢC: Dẩn đầu về công nghệ và khác biệt hoá sản phẩm.<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp; TUYÊN BỐ VỀ ĐẠO ĐỨC KINH DOANH:<br style=\"box-sizing: border-box;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br style=\"box-sizing: border-box;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; Chúng tôi là bạn đồng hành với khách hàng. Chúng tôi không cạnh tranh với các bạn.<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; o&nbsp;&nbsp; Chúng tôi bảo vệ những mẫu mã độc quyền của các bạn và cam kết không đem mẫu mã độc quyền của các bạn để chào bán hay cung cấp cho khách hàng khác.<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp; GIÁ TRỊ: Chúng tôi mang đến cho các bạn:<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; SỰ YÊN TÂM. Các bạn không cần lo lắng về chất lượng sản phẩm khi giao hàng cho đối tác.<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; GIẢI QUYẾT VẤN ĐỀ CHO CÁC BẠN: Chúng tôi thực hiện mọi dạng uốn cong cho các bạn.<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; o&nbsp;&nbsp; SỰ GIA TĂNG LỢI NHUẬN. Các bạn tiết kiệm chi phí nhân công, chi phí nguyên liệu vì không phải xẻ gỗ theo chiều cong.<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;o&nbsp;&nbsp; SỰ THUẬN TIỆN. Các bạn không cần đầu tư vào hạ tầng, máy móc, nhân công nhưng vẫn có ván ép uốn cong đạt chất lượng.<br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; SỰ NHANH CHÓNG. Các bạn mau chóng tạo ra sản phẩm chất lượng cao vì chỉ cần lắp ráp&nbsp;<strong style=\"box-sizing: border-box; font-weight: bold;\">ván ép</strong>&nbsp;uốn cong&nbsp;Nhật Nam&nbsp;vào sản phẩm của các bạn.</span><br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">&nbsp;</div><div style=\"box-sizing: border-box; text-align: justify;\"><img alt=\"ván ép uốn cong\" height=\"263\" src=\"http://vanepnhatnam.com/uploads/about/gioi-thieu-van-ep-1_1.jpg\" width=\"350\" style=\"box-sizing: border-box; border: 0px; margin-right: 5px; float: left;\"></div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: justify;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">&nbsp;&nbsp;<img alt=\"ván ép định hình\" height=\"262\" src=\"http://vanepnhatnam.com/uploads/about/gioi-thieu-van-ep-2.jpg\" width=\"350\" style=\"box-sizing: border-box; border: 0px; margin-right: 3px; margin-left: 3px;\"></span><br style=\"box-sizing: border-box;\">&nbsp;</p><div style=\"box-sizing: border-box; text-align: center;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Nhật Nam hân hạnh được trở thành đối tác tin cậy của quý khách hàng!</span></span></span></div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: justify;\">&nbsp;</p><hr style=\"margin-top: 18px; margin-bottom: 18px; border-top-color: rgb(238, 238, 238);\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: justify;\"><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><span style=\"box-sizing: border-box; font-size: 16px;\">CÔNG TY TNHH VÁN ÉP CƠ KHÍ XÂY DỰNG NHẬT NAM</span><br style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\">Địa chỉ: Trần Văn Mười, ấp Xuân Thới Đông 1, xã Xuân Thới Đông, Hóc Môn</span><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\"><span style=\"box-sizing: border-box; font-size: 14.5455px; font-family: Arial;\">Điện thoại: (028) 3710 9031 – 3593 2187</span><br style=\"box-sizing: border-box;\">Mobile: 098.333.5658 - 090.333.5658<br style=\"box-sizing: border-box;\">Mail:&nbsp;</span><a href=\"mailto:nhatnam@vanepnhatnam.com\" target=\"_blank\" style=\"box-sizing: border-box; color: rgb(26, 63, 94);\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">nhatnam@vanepnhatnam.com</span></a><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">&nbsp;- Website:&nbsp;</span><a href=\"http://vanepnhatnam.com/\" style=\"box-sizing: border-box; color: rgb(26, 63, 94);\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">www.vanepnhatnam.com</span></a></span></p></div>                                                  