INSERT INTO `dichvu` (`id`, `name`, `image`, `summary`, `content`, `keyword`, `datetime`) VALUES
(5, 'Dịch vụ cắt ván MFC - MDF', 'http://localhost/shop3tr/files/dichvu/dich-vu-cat-cua-van-mdf-mfc.jpg', 'Tại kho ván của chúng tôi chẳng những đa dạng các mặt hàng gỗ công nghiệp dùng cho khách hàng lựa chọn mà còn cung ứng dịch vụ cắt cưa ván MFC - MDF theo quy cách yêu cầu.', '<span style=\"color: rgb(34, 34, 34); font-size: 15px;\">Tùy vào loại ván&nbsp;mấy li, cách theo khổ bao nhiêu, số lượng nhiều hay ít&nbsp;mà chúng tôi sẽ báo giá cắt ván khác nhau. Với việc dùng&nbsp;máy cưa chuyên dụng nhập khẩu từ Đức, sản phẩm tấm ván được cắt ra đẹp, điều, thẳng nhu&nbsp;mong&nbsp;muốn. Quý khách hàng chỉ cần đưa thông tin quy cách, chúng tôi sẽ giao hàng nhanh chóng đảm bảo tiến độ thi công sản xuất.</span><br style=\"outline: 0px; transition: all 0.3s ease; color: rgb(34, 34, 34); font-size: 15px;\"><br style=\"outline: 0px; transition: all 0.3s ease; color: rgb(34, 34, 34); font-size: 15px;\"><div class=\"separator\" style=\"outline: 0px; transition: all 0.3s ease; color: rgb(34, 34, 34); font-size: 15px; clear: both; text-align: center;\"><a href=\"https://3.bp.blogspot.com/-5AJh1IwMfbQ/Wd4-B1c01MI/AAAAAAAAAiM/1fygJf6gdwEWpqTHXPG-SHBBbKgh0VwCwCLcBGAs/s1600/dich-vu-cat-cua-van-mdf-mfc.jpg\" imageanchor=\"1\" style=\"outline: 0px; transition: all 0.3s ease; color: rgb(245, 114, 16);\"><img alt=\"dich-vu-cat-cua-van-mdf-mfc\" border=\"0\" data-original-height=\"300\" data-original-width=\"520\" height=\"368\" src=\"https://3.bp.blogspot.com/-5AJh1IwMfbQ/Wd4-B1c01MI/AAAAAAAAAiM/1fygJf6gdwEWpqTHXPG-SHBBbKgh0VwCwCLcBGAs/s640/dich-vu-cat-cua-van-mdf-mfc.jpg\" width=\"640\" style=\"outline: 0px; transition: all 0.3s ease; border: 0px; position: relative; max-width: 100%;\"></a></div><br style=\"outline: 0px; transition: all 0.3s ease; color: rgb(34, 34, 34); font-size: 15px;\"><span style=\"color: rgb(34, 34, 34); font-size: 15px;\">- Dịch vụ cắt cưa ván mdf - Dịch vụ cắt cưa ván mfc - Dịch vụ cắt cưa gỗ ghép - Dịch vụ cắt cưa ván plywood - Dịch vụ cắt cưa ván mdf chống ẩm Hãy liên hệ ngay để được báo giá tốt nhất, nhanh nhất và giao hàng sớm nhất quan Hotline: 0941 36 1818</span>', 'Dịch vụ cắt ván MDF MFC theo yêu cầu', '1517873003'),
(6, 'Nhận gia công cắt cưa VÁN MDF nhanh chuẩn xác thẩm mỹ cao', 'http://localhost/shop3tr/files/dichvu/AAMAAwDGAAgAAQAAAAAAAAytAAAAJGEwMTY0MzgwLWY0MTEtNDg1MC05NDM2LWM5MzE2YmIyOWRmYg.jpg', 'Nhận gia công cắt cưa VÁN MDF nhanh chuẩn xác thẩm mỹ cao. Nhận dán cạnh ván đẹp, giá rẻ, cung cấp phụ kiện đồ gỗ đi kèm, hỗ trợ cắt cnc, khoan ốc liên kết theo yêu cầu.', '<p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\">Là một trong những nhà cung cấp&nbsp;<a href=\"http://www.vanmdf.info/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(130, 123, 233); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; outline: none; cursor: pointer; word-wrap: break-word;\">Ván MDF</a>&nbsp;lớn tại Tân Phú và nhiều quận huyện TPHCM. Chúng tôi cung cấp cho khách hàng giá tốt nhất từ đơn hàng nhỏ đến lớn cùng dịch vụ gia công mô hình khép kín từ khâu cắt, cưa, dán cạnh, cung cấp phụ kiện đồ gỗ, cắt cnc giúp khách hàng tiết kiệm thời gian, chi phí sản xuất.</p><div class=\"slate-resizable-image-embed slate-image-embed__resize-full-width\" data-imgsrc=\"https://media-exp2.licdn.com/mpr/mpr/AAMAAwDGAAgAAQAAAAAAAAytAAAAJGEwMTY0MzgwLWY0MTEtNDg1MC05NDM2LWM5MzE2YmIyOWRmYg.jpg\" style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7); clear: both;\"><img src=\"https://media.licdn.com/mpr/mpr/AAMAAwDGAAgAAQAAAAAAAAytAAAAJGEwMTY0MzgwLWY0MTEtNDg1MC05NDM2LWM5MzE2YmIyOWRmYg.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; outline: 0px; background: transparent; height: auto; max-width: 100%; width: 744px;\"></div><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\">Chúng tôi nhận cắt cưa MDF theo các kích thướt theo qui cách yêu cầu. Có phần mềm tối ưu hóa giúp giảm hiệu ván dư. Hệ thống trang thiết bị&nbsp;máy cưa hiện đại như&nbsp;máy cưa bàn trượt cắt chính xác từng li,&nbsp;máy cưa lọng đứng,&nbsp;máy cưa rong ripsaw nhiều lưỡi,&nbsp;máy cưa panel cnc,&nbsp;máy cưa cắt bàn đẩy,&nbsp;máy cắt phay&nbsp;mộng đa năng,&nbsp;máy cưa đu,&nbsp;máy cưa bàn trượt 45 độ...Tốc độ cắt ván cực nhanh có thể cắt 5-7 tấm/ 1 lần cắt, lập trình cắt hoàn toàn tự động cho độ chính xác tuyệt đối và đường cắt cực kỳ sắc nét cho ra sản phẩm hoàn hảo.</p><div class=\"slate-resizable-image-embed slate-image-embed__resize-full-width\" data-imgsrc=\"https://media-exp2.licdn.com/mpr/mpr/AAMAAwDGAAgAAQAAAAAAAA8DAAAAJGJjN2ZhYjE3LWE2YzgtNDhiMS1iZWIzLTBkZmU2YWE2NjU5YQ.png\" style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7); clear: both;\"><img src=\"https://media.licdn.com/mpr/mpr/AAMAAwDGAAgAAQAAAAAAAA8DAAAAJGJjN2ZhYjE3LWE2YzgtNDhiMS1iZWIzLTBkZmU2YWE2NjU5YQ.png\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; outline: 0px; background: transparent; height: auto; max-width: 100%; width: 744px;\"></div><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\"><br></p><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\">Hệ thống máy khoan ốc liên kết tự động khoan nhanh và độ chuẩn xác tuyệt đối với thước đo điện tử giúp cho việc lắp ráp sản phẩm nhanh chóng và chính xác. Ngoài ra chúng tôi nhận dán cạnh mfc hoặc cạnh&nbsp;<a href=\"http://www.vanmdf.info/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(130, 123, 233); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; outline: none; cursor: pointer; word-wrap: break-word;\">ván mdf</a>&nbsp;phủ melamine theo yêu cầu đảm bảo tính thẩm mỹ cao.</p><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\">Ngoài ra chúng tôi là đơn vị liên kết phân phối các dòng sản phẩm phụ kiện đồ gỗ như cam chốt, ray trượt, khóa, tay nắm, bản lề...từ các nhà uy tín như blum, halefe, cariny để khách hàng lựa chọn ngay tại kho&nbsp;mà không phải&nbsp;mất thời gian tìm kiếm.</p><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\">Bằng mô hình khép kín từ cung cấp vật liệu đến dịch vụ gia công cắt, dán cạnh giúp khách hàng giảm tải chi phí sản xuất và tiết kiệm nhiều thời gian. Kiểm soát được chất lượng sản phẩm đầu ra và linh hoạt trong việc đáp ứng đa dạng nhu cầu của khách hàng.</p><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; outline: 0px; background: transparent;\">Bài viết khác</strong></p><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; outline: 0px; background: transparent;\">-&nbsp;</strong><a href=\"http://www.vanmdf.info/2018/01/cac-tieu-chuan-chat-luong-van-mdf-do-luong-trung-tam-3.html\" target=\"_blank\" rel=\"nofollow noopener\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(130, 123, 233); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; outline: none; cursor: pointer; word-wrap: break-word;\">Các tiêu chuẩn chất lượng VÁN MDF [Đo lường bởi trung tâm 3]</a></p><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\">-&nbsp;<a href=\"http://www.vanmdf.info/2018/01/phan-biet-van-mdf-mfc-hdf-va-go-ghep.html\" target=\"_blank\" rel=\"nofollow noopener\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(130, 123, 233); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; outline: none; cursor: pointer; word-wrap: break-word;\">Phân biệt VÁN MDF - MFC - HDF và GỖ GHÉP</a></p><p style=\"margin: 3.2rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 32px; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\">Để nhận được báo giá nhanh dịch vụ gia công cắt, dán cạnh, sơn trắng, phủ keo...Liên hệ zalo [0941 36 1818] hoặc web [http://www.vanmdf.info/].</p>', 'cắt VÁN MDF nhanh chuẩn xác thẩm mỹ cao', '1517873184'),
