INSERT INTO `sanpham` (`id`, `name`, `category`, `content`, `keyword`, `price`, `quantity`, `size`, `thick`, `image`, `status`, `hot`, `datetime`) VALUES
(1, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517935416'),
(2, 'GỖ MFC – VÁN DĂM PHỦ MELAMINE', 'Ván MDF', '                                              <p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Ván MFC</span> gồm 2 thành phần: ván dăm phủ giấy Melamine. Ván dăm có độ cứng chắc, khả năng bám vít tốt, kết hợp giấy Melamine cho khả năng chống ẩm, chống xước hiệu quả.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><a href=\"https://gominhlong.com/san-pham/tam-vat-lieu-phu-melamine/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(51, 122, 183);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Gỗ MFC</span></a> là sản phẩm được nhiều khách hàng tín nhiệm ưa dùng.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">Bên cạnh MFC, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">giấy Melamine</span> còn phủ trên bề mặt ván MDF, ván dán …</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><em style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Tìm hiểu thêm về gỗ MFC <a href=\"https://gominhlong.com/gioi-thieu-san-pham-van-go-cong-nghiep-mfc/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(51, 122, 183);\">tại đây</a>.</em></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><em style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Chuyển sang tab Bộ sưu tập đơn sắc, vân gỗ, vân trang trí để xem tất cả các màu Melamine</em></p><figure id=\"attachment_5699\" class=\"wp-caption aligncenter\" style=\"box-sizing: border-box; margin: 5px auto; padding: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; max-width: 1000px; text-align: center; width: auto; clear: both; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><img class=\"wp-image-5699 size-full\" src=\"https://gominhlong.com/wp-content/uploads/2017/05/go-mfc.jpg\" alt=\"Gỗ MFC\" width=\"1000\" height=\"600\" srcset=\"https://gominhlong.com/wp-content/uploads/2017/05/go-mfc.jpg 1000w, https://gominhlong.com/wp-content/uploads/2017/05/go-mfc-300x180.jpg 300w, https://gominhlong.com/wp-content/uploads/2017/05/go-mfc-768x461.jpg 768w, https://gominhlong.com/wp-content/uploads/2017/05/go-mfc-600x360.jpg 600w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border-width: 0px; border-color: initial; border-image: initial; max-width: 100%; height: auto; width: auto;\"><figcaption class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Gỗ MFC</figcaption></figure><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">GIẤY MELAMINE</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">1. Giấy trang trí phủ Melamine là gì?</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">Melamine là bề mặt giấy trang trí ép lên tấm vật liệu gỗ công nghiệp ứng dụng vào sản xuất đồ nội thất. Bản chất là một loại giấy nền được tạo vân, tạo màu sắc để phù hợp với xu hướng nội thất, Melamine được nhúng keo và sấy khô, cắt thành khổ.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"> </p><figure id=\"attachment_1836\" class=\"wp-caption aligncenter\" style=\"box-sizing: border-box; margin: 5px auto; padding: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; max-width: 900px; text-align: center; width: auto; clear: both; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><img class=\"size-full wp-image-1836\" src=\"https://gominhlong.com/wp-content/uploads/2017/05/Be-mat-Melamine.png\" alt=\"Bề mặt Melamine\" width=\"900\" height=\"600\" srcset=\"https://gominhlong.com/wp-content/uploads/2017/05/Be-mat-Melamine.png 900w, https://gominhlong.com/wp-content/uploads/2017/05/Be-mat-Melamine-300x200.png 300w, https://gominhlong.com/wp-content/uploads/2017/05/Be-mat-Melamine-768x512.png 768w, https://gominhlong.com/wp-content/uploads/2017/05/Be-mat-Melamine-600x400.png 600w\" sizes=\"(max-width: 900px) 100vw, 900px\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border-width: 0px; border-color: initial; border-image: initial; max-width: 100%; height: auto; width: auto;\"><figcaption class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Bề mặt Melamine</figcaption></figure><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">2.    Thành phần cấu tạo</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– Giấy trang trí phủ Melamine thực chất là một loại giấy nền được tạo vân, tạo màu sắc sau đó được nhúng qua keo và phủ một lớp Melamine lên trên cùng.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Giấy nền có thành phần chính là: Bột gỗ, Titan và các chất khác.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Melamine</span> là một bazơ hữu cơ ít tan trong nước và có công thức hóa học là C3H6N6.</p><figure id=\"attachment_1840\" class=\"wp-caption aligncenter\" style=\"box-sizing: border-box; margin: 5px auto; padding: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; max-width: 900px; text-align: center; width: auto; clear: both; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><img class=\"size-full wp-image-1840\" src=\"https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine.png\" alt=\"Giấy Melamine\" width=\"900\" height=\"600\" srcset=\"https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine.png 900w, https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine-300x200.png 300w, https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine-768x512.png 768w, https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine-600x400.png 600w\" sizes=\"(max-width: 900px) 100vw, 900px\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border-width: 0px; border-color: initial; border-image: initial; max-width: 100%; height: auto; width: auto;\"><figcaption class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Giấy Melamine</figcaption></figure><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">3.    Sản xuất</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– Trước hết, giấy nền được tạo vân và tạo màu sắc.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Sau đó, giấy được nhúng keo và phủ <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Melamine</span>.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Cuối cùng, giấy được sấy khô và cắt thành khổ quy định.</p><figure id=\"attachment_1842\" class=\"wp-caption aligncenter\" style=\"box-sizing: border-box; margin: 5px auto; padding: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; max-width: 900px; text-align: center; width: auto; clear: both; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><img class=\"wp-image-1842 size-full\" src=\"https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long.png\" alt=\"Giấy Melamine chuẩn bị được đưa vào quy trình ép\" width=\"900\" height=\"600\" srcset=\"https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long.png 900w, https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long-300x200.png 300w, https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long-768x512.png 768w, https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long-600x400.png 600w\" sizes=\"(max-width: 900px) 100vw, 900px\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border-width: 0px; border-color: initial; border-image: initial; max-width: 100%; height: auto; width: auto;\"><figcaption class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Giấy Melamine chuẩn bị được đưa vào quy trình ép</figcaption></figure><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">4.    Ưu điểm</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– Màu sắc phong phú.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Bề mặt đa dạng.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Bền màu, bề mặt khó trầy xước.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Quá trình gia công bề mặt đơn giản và nhanh.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Giấy trang trí phủ <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Melamine</span> có giá thành hợp lý.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">5.    Nhược điểm</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– So với các bề mặt khác như Laminate hay Acrylic, giấy trang trí phủ Melamine có hạn chế về tạo dáng hơn.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Bề mặt chịu xước, chịu mài mòn và chịu va đập kém hơn bề mặt Laminate.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">6.    Ứng dụng</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– Thông thường, giấy trang trí phủ <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Melamine</span> được ép lên các tấm vật liệu như ván dăm hay ván MDF để ứng dụng trong sản xuất nội thất như bàn ghế, giường tủ, vách ngăn, vân vân.</p>                                    ', 'gỗ MFC, mfc, ván mfc, trang trí', '350000', '30', '20x30 m', '50mm', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p30.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p10.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p9.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p27.jpg\"]', 'true', '', '1517961588'),
(3, 'Ván Okan – ván okal', 'Ván Okal', '<p style=\"margin: 13px 0px; padding: 0px; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.8);\"><a title=\"Ván Okan\" href=\"http://vanepducphat.com/van-okan\" style=\"transition: all 0.5s ease 0s; margin: 0px; padding: 0px; line-height: 22.75px; color: rgb(19, 229, 0);\">Ván Okan</a>&nbsp;(<a title=\"ván okal\" href=\"http://vanepducphat.com/van-okan\" style=\"transition: all 0.5s ease 0s; margin: 0px; padding: 0px; line-height: 22.75px; color: rgb(19, 229, 0);\">ván okal</a>)hay còn goi là Ván dăm (PB) là gỗ nhân tạo được sản xuất từ nguyên liệu gỗ rừng trồng (bạch đàn, keo, cao su…), có độ bền cơ lý cao, kích thước bề mặt rộng, phong phú về chủng loại. . Ván dăm được sản xuất bằng quá trình ép dăm gỗ đã trộn keo, tương tự như MDF nhưng gỗ được xay thành dăm, nên chúng có chất lượng kém hơn ván sợi.</p><div id=\"attachment_46\" class=\"wp-caption aligncenter\" style=\"margin: 10px auto; border: 1px solid rgb(221, 221, 221); background-color: rgb(243, 243, 243); padding-top: 4px; text-align: center; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; width: 310px;\"><a href=\"http://vanepducphat.com/wp-content/uploads/2014/10/van-okan.jpg\" rel=\"lightbox[45]\" style=\"transition: all 0.5s ease 0s; margin: 0px; padding: 0px; line-height: 22.75px; color: rgb(19, 229, 0);\"><img class=\"wp-image-46 size-medium\" src=\"http://vanepducphat.com/wp-content/uploads/2014/10/van-okan-300x261.jpg\" alt=\"ván okan\" width=\"300\" height=\"261\" srcset=\"http://vanepducphat.com/wp-content/uploads/2014/10/van-okan-300x261.jpg 300w, http://vanepducphat.com/wp-content/uploads/2014/10/van-okan.jpg 395w\" sizes=\"(max-width: 300px) 100vw, 300px\" style=\"border-width: 0px; border-color: initial; border-image: initial; margin: 0px auto; display: block; padding: 0px; max-width: 683px !important;\"></a><p class=\"wp-caption-text\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 4px 5px; font-size: 11px; line-height: 17px;\">ván okan</p></div><p style=\"margin: 13px 0px; padding: 0px; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.8);\">Cốt Ván dăm chủ yếu được phủ nhựa Melamine (MFC) tạo thành nguyên liệu phục vụ trong lĩnh vực nội thất văn phòng.</p><p style=\"margin: 13px 0px; padding: 0px; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.8);\">ván okal – Ván dăm thao tác trên máy cũng như bắt đinh ốc đều tốt. Đặc biệt do giá rẻ hơn nguyên liệu gỗ đặc nên ván dăm được sử dụng phổ biến.</p><p style=\"margin: 13px 0px; padding: 0px; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.8);\">Với bề mặt phẳng, rắn chắc, đồng nhất, bề mặt ván dăm là lựa chọn lí tưởng cho những gia công ứng dụng như phủ veneer, dán keo dưới lực ép cao hay thấp, phủ melamine, phủ giấy, dán vinyl, in trực tiếp, và phủ coating. Các chất nền có giá thành kinh tế và các cách phủ mặt trang trí cung cấp cho khách hàng nhiều lựa chọn và làm cho ván dăm có vị trí cạnh tranh trên thị trường nguyên liệu gỗ.</p>', 'ván okal, ván okan, ván ép', '200000', '21', '40x60 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p6.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p8.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p16.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p24.jpg\"]', 'true', '', '1517976859'),
(4, 'Tấm  veneer', 'Tấm Veneer', '                                              <p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Nếu cây gỗ dày 300mm và rộng 200mm dài 2500mm thì sẽ lạng ra khoảng 1500 – 3000m2 gỗ veneer, tùy từng loại hao hụt Sau khi được lạng, gỗ veneer được dán vào các loại cốt gỗ công nghiệp khác nhau như gỗ MDF, gỗ Ván dán, gỗ figer, gỗ ván dăm, để làm ra các sản phẩm nội thất. Do lạng từ cây gỗ tự nhiên nên bề mặt gỗ veneer không khác gì gỗ tự nhiên cả.<br style=\"box-sizing: border-box;\">Những năm trở lại đây, gỗ tự nhiên đã dần dần cạt kiệt bởi sự khai thác, tàn phá của con người, các sản phẩm khác bắt đầu xuất hiện và thay thế gỗ tự nhiên một cách hoàn hảo, nổi bật hơn cả đó là gỗ Veneer, vậy veneer và gỗ tự nhiên khác nhau như thế nào?</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\"><img title=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" alt=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" class=\"aligncenter lazyloaded\" src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/wood_viet_nam.jpg\" data-lazy-src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/wood_viet_nam.jpg\" width=\"382\" height=\"273\" data-was-processed=\"true\" style=\"box-sizing: border-box; border: 0px; display: block; margin: 5px auto; max-width: 100%;\"></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px;\">Gỗ tự nhiên: là loại gỗ thịt được xẻ ra từ cây gỗ trong rừng và về chế biến thành gỗ tự nhiên, gỗ tự nhiên sau khi ngâm tẩm sấy có thể làm các loại sản phẩm<span style=\"box-sizing: border-box; font-weight: 700;\"><em style=\"box-sizing: border-box;\"><a title=\"Noi that dep\" href=\"http://noithatducduong.com/\" target=\"_blank\" style=\"box-sizing: border-box; color: rgb(138, 109, 59); font-size: 14px;\"> nội thất</a></em></span> theo yêu cầu. gỗ tự nhiên đã ăn sâu vào tiềm thức của người dân Việt Nam mình nên hầu như ai trong chúng ta đều biết cả. Ưu điểm của gỗ tự nhiên là chắc chắn, bền và đẹp. tuy nhiên nhược điểm<span style=\"box-sizing: border-box; font-weight: 700;\"> <a title=\"Cửa gỗ tự nhiên\" href=\"http://noithatducduong.com/products/cua-go-tu-nhien/\" target=\"_blank\" style=\"box-sizing: border-box; color: rgb(138, 109, 59); font-size: 14px;\">của gỗ tự nhiên</a></span> cũng nhiều như, giá cả rất cao, hay bị cong vênh, mối mọt, nứt toác nếu không có quy trình ngâm tẩm sấy tốt. Tiếp nữa là nguồn gỗ ngày càng cạt kiệt thì gỗ tự nhiên ngày càng hiếm, việc dùng gỗ tự nhiên nhiều sẽ hủy hoại môi trường sinh thái và làm gia tăng nhiệt độ của trái đất.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\"><img title=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" alt=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" class=\"aligncenter lazyloaded\" src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/Veneer_2.jpg\" data-lazy-src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/Veneer_2.jpg\" width=\"400\" height=\"300\" data-was-processed=\"true\" style=\"box-sizing: border-box; border: 0px; display: block; margin: 5px auto; max-width: 100%;\"></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Gỗ Veneer: Nói nôm na cho mọi người dễ hiểu, gỗ veneer chính là gỗ tự nhiên, tuy nhiên được lạng mỏng từ cây gỗ tự nhiên, gỗ veneer chỉ dày từ 1Rem cho đến 2ly là nhiều, một cây gỗ tự nhiên nếu lạng mỏng ra thì được rất nhiều gỗ veneer. Nếu cây gỗ dày 300mm và rộng 200mm dài 2500mm thì sẽ lạng ra khoảng 1500 – 3000m2 gỗ veneer, tùy từng loại hao hụt. Sau khi được lạng, gỗ veneer được dán vào các loại cốt gỗ công nghiệp khác nhau như gỗ MDF, gỗ Ván dán, gỗ figer, gỗ ván dăm, để làm ra các sản phẩm nội thất. Do lạng từ cây gỗ tự nhiên nên bề mặt gỗ veneer không khác gì gỗ tự nhiên cả.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Ưu điểm của gỗ Veneer: Giá thành rẻ hợp lý, một cây gỗ tự nhiên khi lạng ra thành gỗ veneer có thể sản xuất ra rất nhiều bàn ghế..gỗ veneer chống cong vênh, mối mọt và có bề mặt sáng ( do được chọn gỗ), có thể ghép trang trí vân chéo, vân ngang, vân dọc, đảo vân, có thể chạy chỉ chìm, tùy loại… mà vẫn giữ được nét đẹp và hiện đại của mình. Nếu sử dụng cốt gỗ Finger ( tức là cốt gỗ thịt tuy nhiên được xẻ ra từ các cành cây nhỏ ghép đan chéo tay nhau (finger- ngón tay) để tạo độ dài, rộng.) thì gỗ veneer lại biến thành gỗ tự nhiên hoàn toàn và rất bền, chắc chắn, đẹp mà giá thành lại rẻ.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\"><img title=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" alt=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" class=\"aligncenter lazyloaded\" src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/20110811095935_tu-bep1.jpg\" data-lazy-src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/20110811095935_tu-bep1.jpg\" width=\"480\" height=\"270\" data-was-processed=\"true\" style=\"box-sizing: border-box; border: 0px; display: block; margin: 5px auto; max-width: 100%;\"></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Nhược điểm gỗ veneer:</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Do cốt gỗ là gỗ công nghiệp nên gỗ veneer không chịu được nước, dễ bị sứt, nếu di chuyển nhiều khi đã lên thành thành phẩm thì hay bị hư hỏng, rạn nứt, chính vì vậy gỗ veneer là được nhiều người dùng tuy nhiên phải ở nhưng nơi quanh năm không bị nước tràn vào, và ít phải di chuyển. Ở các nước hiện đại như Châu Âu, châu Mỹ, hoặc một vài nước hiện đại ở châu Á, việc dùng gỗ veneer vào chế tạo các sản phẩm nội thất đã có từ cách đây 30-40 năm, khi họ ý thức được rừng ngày cạn kiệt, họ thấy rằng gỗ veneer có rất nhiều ưu điểm vượt trội mà lại cứu được môi trường sống của họ, cứu được sạt lở đất và sự nóng lên của trái đất nên họ chuyển sang dùng nhiều, vậy tại sao chúng ta lại không làm theo họ, chúng ta đừng nên hủy hoại chính môi trường sống của chúng ta. Nắm bắt được thị hiếu vô cùng lớn của thị trường trong thế kỷ 21.</p><div><br></div>                                    ', 'tấm veneer, nhập khẩu, veneer', '400000', '10', '50x50 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p3.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p6.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p8.jpg\"]', 'true', '', '1517977157');
