(6, 'Gỗ ghép', 'Tấm Lót Sàn', '                                              <h2 id=\"entry-description\" style=\"font-family: \"Roboto Condensed\", sans-serif; color: rgb(56, 56, 56); font-size: 16px; font-weight: bold; line-height: 23px; text-align: justify; margin-top: 0px;\">Bảng giá Gỗ ghép - Gỗ Sài Gòn Tín Việt chuyên phân phối các loại gỗ ghép tràm, gỗ ghép thông, gỗ ghép cao su, gỗ ghép xoan mộc từ 8mm (ly), 12mm(ly), 18mm(ly)...</h2><div class=\"cont\" style=\"font-family: \"Roboto Condensed\", sans-serif; color: rgb(51, 51, 51); font-size: 16px; margin-top: 12px; margin-bottom: 38px;\"><p style=\"text-align: justify;\"><strong>Gỗ ghép hay còn gọi </strong><span style=\"font-family: \"times new roman\", times, serif;\"><strong style=\"font-family: \"Roboto Condensed\", sans-serif;\">Ván ghép thanh </strong>được sản xuất từ nguyên liệu chính là gỗ rừng trồng. Những thanh gỗ nhỏ đã qua xử lý hấp sấy, trên dây chuyền công nghệ tiên tiến, thiết bị hiện đại, gỗ được cưa, bào, phay, ghép, ép, chà và sơn phủ trang trí. Ván ghép thanh được sử dụng rộng rãi trong các lĩnh vực sản xuất đồ mộc, trang trí nội thất, sản xuất ván sàn và nhiều sản phẩm khác.</span></p><p style=\"text-align: justify;\"><span style=\"font-family: \"times new roman\", times, serif;\"><strong><em style=\"font-family: \"Roboto Condensed\", sans-serif;\">► Có 4 cách thức ghép gỗ ghép</em>: Ghép song song, ghép mặt, ghép cạnh, ghép giác. </strong></span></p><p style=\"text-align: justify; margin-left: 40px;\"><span style=\"font-family: \"times new roman\", times, serif;\"><em style=\"font-family: \"Roboto Condensed\", sans-serif;\"><strong>+ Gỗ ghép song song (Ván ghép dọc, ghép ngang - Solid Laminated):</strong></em> Gồm nhiều thanh gỗ cùng chiều dài, có thể khác chiều rộng, ghép song song với nhau. </span></p><p style=\"text-align: justify; margin-left: 40px;\"><span style=\"font-family: \"times new roman\", times, serif;\"><strong style=\"font-family: \"Roboto Condensed\", sans-serif;\"><em>+ Gỗ ghép mặt (Ván ghép thanh mộng đứng - Finger Joint Lamination):</em></strong><span style=\"font-family: \"Roboto Condensed\", sans-serif; color: rgb(0, 0, 255); line-height: 20px; background-color: rgb(251, 251, 251);\"> </span>Gồm nhiều thanh gỗ ngắn, ở hai đầu được xẻ theo hình răng lược rồi ghép lại thành những thanh có chiều dài bằng nhau, rồi tiếp tục ghép song song các thanh, cho nên chỉ nhìn thấy vết ghép hình răng lược trên bề mặt ván.</span></p><p style=\"text-align: justify; margin-left: 40px;\"><span style=\"font-family: \"times new roman\", times, serif;\"><strong><em style=\"font-family: \"Roboto Condensed\", sans-serif;\">+</em></strong><strong style=\"font-family: Arial, Verdana; color: rgb(0, 0, 255); font-size: medium; margin: 0px; padding: 0px; line-height: 20px; background-color: rgb(251, 251, 251);\"> </strong><strong><em style=\"font-family: \"Roboto Condensed\", sans-serif;\">Ván ghép thanh mộng nằm (Butt Joint Lamination): </em></strong>Gồm nhiều thanh gỗ ngắn, ghép lại thành những thanh có chiều dài bằng nhau, nhưng mối ghép hình răng cưa sẽ được đưa chìm bên trong bề mặt ván ghép thanh.</span></p><p style=\"text-align: justify;\"><span style=\"font-family: \"times new roman\", times, serif;\">► <strong>Bao gồm các sản phẩm:</strong></span></p><p style=\"text-align: justify; margin-left: 40px;\"><span style=\"font-family: \"times new roman\", times, serif;\"><strong>Gỗ ghép Tràm, G</strong><strong style=\"font-size: 14px;\">ỗ ghép </strong><strong style=\"font-size: 14px;\">Quế, G</strong><strong style=\"font-size: 14px;\">ỗ ghép </strong><strong style=\"font-size: 14px;\">Xoan mộc, </strong><strong style=\"font-size: 14px;\">Gỗ ghép </strong><strong style=\"font-size: 14px;\">Cao su, </strong><strong style=\"font-size: 14px;\">Gỗ ghép </strong><strong style=\"font-size: 14px;\">Thông, </strong><strong style=\"font-size: 14px;\">Gỗ ghép </strong><strong style=\"font-size: 14px;\">Sồi (Oak), </strong><strong style=\"font-size: 14px;\">Gỗ ghép </strong><strong style=\"font-size: 14px;\">Ash (Tần Bì), </strong><strong style=\"font-size: 14px;\">Gỗ ghép </strong><strong style=\"font-size: 14px;\">Căm xe, </strong><strong style=\"font-size: 14px;\">Gỗ ghép Tạp, </strong><strong style=\"font-size: 14px;\">Gỗ ghép phủ veneer, Gỗ ghép phủ phim, </strong></span><strong style=\"font-family: \"times new roman\", times, serif; font-size: 14px;\">Gỗ ghép phủ keo</strong><strong style=\"font-family: \"times new roman\", times, serif; font-size: 14px;\">,</strong><span style=\"font-family: \"times new roman\", times, serif;\">... <strong style=\"font-family: \"Roboto Condensed\", sans-serif;\">Với các quy cách chuẩn</strong> 1,2m x 2,4m và 1m x 2m, <strong style=\"font-family: \"Roboto Condensed\", sans-serif;\">đa dạng các chiều dầy</strong> 8mm, 10mm, 12mm, 15mm, 18mm, 20mm, 25mm, 27mm, 30mm,...</span></p><p style=\"text-align: justify; margin-left: 40px;\"> </p><p style=\"text-align: center;\"> </p><p style=\"text-align: justify;\"> </p><p style=\"text-align: justify;\"><strong><br>Hình ảnh một số loại gỗ ghép</strong></p><p style=\"text-align: justify;\"><img alt=\"gỗ ghép thông\" height=\"332\" src=\"http://www.gosaigon.vn/image/data/SAN_PHAM/GOGHEP/go-ghep%20thong.jpg\" width=\"500\" style=\"max-width: 100%; height: auto; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 3px; display: block; margin: auto;\"></p><p style=\"text-align: center;\">Gỗ ghép thông</p><p style=\"text-align: justify;\"><img alt=\"gỗ ghép thông\" height=\"400\" src=\"http://www.gosaigon.vn/image/data/SAN_PHAM/GOGHEP/go%20ghep%20thong.jpg\" width=\"533\" style=\"max-width: 100%; height: auto; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 3px; display: block; margin: auto;\"></p><p style=\"text-align: center;\">Gỗ ghép cao su</p><p style=\"text-align: justify;\"><img alt=\"gỗ ghép tràm\" height=\"450\" src=\"http://www.gosaigon.vn/image/data/SAN_PHAM/GOGHEP/gogheptram.JPG\" width=\"600\" style=\"max-width: 100%; height: auto; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 3px; display: block; margin: auto;\"></p><p style=\"text-align: center;\">Gỗ ghép tràm</p><p style=\"text-align: justify;\"><img alt=\"gỗ ghép xoan đào\" height=\"450\" src=\"http://www.gosaigon.vn/image/data/SAN_PHAM/GOGHEP/goghepxoandao.jpg\" width=\"600\" style=\"max-width: 100%; height: auto; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 3px; display: block; margin: auto;\"></p><p style=\"text-align: center;\">Gỗ ghép veneer xoan đào</p><p style=\"text-align: justify;\">                     <br><img alt=\"Kho ván gỗ công nghiệp\" height=\"476\" src=\"http://www.gosaigon.vn/image/data/Kho_Go/kho%20go.jpg\" width=\"1200\" style=\"max-width: 100%; height: auto; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 3px; display: block; margin: auto;\"></p><p style=\"text-align: center;\">Kho ván gỗ công nghiệp tại Sài Gòn</p></div>                                    ', 'gỗ ghép thông, xoan, tràm', '240000', '60', '200 x 300 m', '20mm', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p25.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p9.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p24.jpg\"]', 'true', 'true', '1517977716'),
