box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; font-family: tahoma, arial, helvetica, sans-serif; color: rgb(0, 0, 128);\">THÔNG SỐ KỸ THUẬT:</span></strong></span></h2><ul style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(119, 119, 119); font-family: Roboto; list-style-type: square;\"><li style=\"box-sizing: border-box; line-height: 24px; margin-bottom: 0px;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; font-size: 18px;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 255);\"><strong style=\"box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; font-family: tahoma, arial, helvetica, sans-serif;\">Quy cách:&nbsp;</span></strong></span><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-family: tahoma, arial, helvetica, sans-serif;\">1.07m</span></span></li></ul><ul style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(119, 119, 119); font-family: Roboto; list-style-type: square;\"><li style=\"box-sizing: border-box; line-height: 24px; margin-bottom: 0px;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; font-size: 18px;\"><strong style=\"box-sizing: border-box; font-weight: bold;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 255);\">Độ dày:</span>&nbsp;</span></strong><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-family: tahoma, arial, helvetica, sans-serif;\">0.9mm, 1.0mm, 1.5mm, 2.0mm, 3.0mm…</span></span></li></ul><ul style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(119, 119, 119); font-family: Roboto; list-style-type: square;\"><li style=\"box-sizing: border-box; line-height: 24px; margin-bottom: 0px;\"><span style=\"box-