 rgb(0, 0, 128);\"><span style=\"box-sizing: border-box; font-weight: 800; margin-bottom: 0px;\">Hình Minh Họa</span></span></div></td></tr><tr style=\"box-sizing: border-box;\"><td style=\"box-sizing: border-box; padding: 8px; text-align: center;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\">5</strong>&nbsp;Sóng Vuông</span></td><td style=\"box-sizing: border-box; padding: 8px; margin-bottom: 0px; text-align: center;\"><div class=\"separator\" style=\"box-sizing: border-box; margin-bottom: 0px;\"><img class=\"aligncenter\" title=\"Hình minh họa Tôn nhựa lấy sáng sợi thủy tinh FRP loại 5 sóng vuông khổ 1,07m\" src=\"https://3.bp.blogspot.com/-ny9zuVyfEwc/Uy6UPeY83II/AAAAAAAAH4I/EHvh8DiVP3A/s1600/ton-lop-5-song-vuong.png\" alt=\"Hình minh họa Tôn nhựa lấy sáng sợi thủy tinh FRP loại 5 sóng vuông khổ 1,07m\" border=\"0\" style=\"box-sizing: border-box; border: 0px; user-select: none; -webkit-user-drag: none; max-width: 100%; height: auto; clear: both; display: block; margin: 4px auto 0px;\"></div></td></tr><tr style=\"box-sizing: border-box;\"><td style=\"box-sizing: border-box; padding: 8px; text-align: center;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\">7</strong>&nbsp;Sóng Vuông</span></td><td style=\"box-sizing: border-box; padding: 8px; margin-bottom: 0px; text-align: center;\"><div class=\"separator\" style=\"box-sizing: border-box; margin-bottom: 0px;\"><img class=\"aligncenter\" title=\"Hình minh họa Tôn nhựa lấy sáng sợi thủy tinh FRP loại 7 sóng vuông khổ 1,07m\" src=\"https://4.bp.blogspot.com/-7kqPp6QmN9w/Uy6UU5U_MWI/AAAAAAAAH4Q/mhk7_PaPqSA/s1600/ton-lop-7-song-vuong.png\" alt=\"Hình minh họa Tôn nhựa lấy sáng sợi thủy tinh FRP loại 7 sóng vuông khổ 1,07m\" border=\"0\" style=\"box-sizing: border-box; border: 0px; user-select: none; -webkit-user-drag: none; max-width: 100%; height: auto; clear: both; display: block; margin: 4px auto 0px;\"></div></td></tr><tr style=\"box-sizing: border-box; margin-bottom: 0px;\"><td style=\"box-sizing: border-box; padding: 8px; text-align: center;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\">9</strong>&nbsp;Sóng Vuông</span></td><td style=\"box-sizing: border-box; padding: 8px; margin-bottom: 0px; text-align: center;\"><div class=\"separator\" style=\"box-sizing: border-box; margin-bottom: 0px;\"><img class=\"aligncenter\" title=\"Hình minh họa Tôn nhựa lấy sáng sợi thủy tinh FRP loại 9 sóng vuông khổ 1,07m\" src=\"https://1.bp.blogspot.com/-_DNVdbQ1cvY/Uy6SXojl9MI/AAAAAAAAH3w/vA-6gH53WZ4/s320/ton-lop-9-song-vuong.png\" alt=\"Hình minh họa Tôn nhựa lấy sáng sợi thủy tinh FRP loại 9 sóng vuông khổ 1,07m\" border=\"0\" style=\"box-sizing: border-box; border: 0px; user-select: none; -webkit-user-drag: none; max-width: 100%; height: auto; clear: both; display: block; margin: 4px auto 0px;\"></div></td></tr></tbody></table><hr style=\"height: 1px; margin: 22px 0px; border-top: 0px; background-image: linear-gradient(to right, transparent, rgba(0, 0, 0, 0.15), transparent); color: rgb(119, 119, 119); font-family: Roboto;\"><h2 style=\"box-sizing: border-box; font-family: Roboto; line-height: 1.4; color: rgb(29, 33, 39); margin: 0px 0px 0.7em; font-size: 1.4286em; letter-spacing: -1px;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; font-family: tahoma, arial, helvetica, sans-serif; font-size: 17px; color: rgb(0, 0, 128);\"><span style=\"box-sizing: border-box; font-weight: 800; margin-bottom: 0px;\">ƯU ĐIỂM NỔI BẬT CỦA TÔN LẤY SÁNG POLYCARBNATE</span></span></h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\"><strong style=\"box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\">Tôn nhựa lấy sáng Polycarbonate</strong>&nbsp;là dòng sản phẩm có trọng lượng tương tối nhẹ, nhẹ hơn kính 6 lần nên dễ dàng vận chuyển và thì công công trình nhất là đối với các công trình trên cao, các tấm tôn khác có trọng lượng lớn hơn thường rất khi vận chuyển lên trên và mất rất nhiều công sức và nhân lực ngược lại dòng tôn nhựa này lại khác rất nhẹ và không tốn công sức và nhân lực khi thi công.</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\">Nhưng tuy nhẹ mà sản phẩm này lại có độ cứng gấp 2 lần so với kính đó các bạn à, cũng chính vì vậy nên rất nhiều các ông chủ đầu tư đã sử dụng tôn nhựa để thay thế kính lấy sáng cho các công trình xây dựng của mình. Với bề mặt rỗng nên tôn nhựa lấy sáng polycarbonate được gia tăng tối đa khả năng lấy sáng cho nơi bạn cần ánh sáng (có thể nhìn xuyên qua 85% của ánh sáng), cho độ truyền ánh sáng cao và ngăn các tia có hại ảnh hưởng đến đời sống sinh hoạt của chúng ta.</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\">Ngoài tính năng lấy sáng và chống tia cực tím thì&nbsp;<strong style=\"box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\">tôn polycarbonate</strong>&nbsp;còn có thể cách âm thanh bên trong phòng, nhà ở với bên ngoài rất tốt giúp cho chúng ta có một không gian yên tĩnh và thoải mái không lo ồn ào do tạp âm gây ra làm căng thẳng và khó chịu ảnh hưởng đến công việc. Và hơn thế nữa nó có thể cách nhiệt cao hơn gấp 2 lần so với kính thông thường có cùng độ dầy. Sức bền vật liệu thì luôn luôn cao hơn kính gấp nhiều lần (kính dòn và dễ vỡ). Tôn nhựa cũng dễ uốn cong, tạo thành những hình thù khác, là vật liệu lý tường, thích hợp cho những công trình có thiết kế dạng khó trong xây dựng như làm các loại mái vòm, khung uốn lượn. Hơn nữa tôn nhựa dễ cắt, dễ xử lý bằng dụng cụ thông thường không cần dùng tới các loại máy cắt. Có khả năng kháng hóa chat độc hại và tác động từ môi trường xung quanh. An toàn hơn so với kính thông thường chúng ta thường sử dụng. Và khi có tác động thì chúng sẽ bị nứt chứ không bị vỡ vụn ra như kính nên rất an toàn khi chúng ta sử dụng</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\">Một tính năng cũng vô cùng tốt của tôn nhựa lấy sáng polycarbonate đó là khả năng chịu nhiệt và kháng lửa cực kỳ tốt, trong một giới hạn nhiệt độ cực rộng từ -40o C đến +120oC, cho nên rất khó bắt lửa hay cháy chập do điện gây ra. Lắp đặt đơn giản và dễ dàng lau chùi, làm sạch.</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto; text-align: center;\"><img class=\"alignnone size-full wp-image-868\" src=\"https://vatlieuxaydunghcm.net/wp-content/uploads/2017/04/mai-lay-sang-ton-polycarbonate.jpg\" alt=\"Tôn nhựa lấy sáng Polycarbonate trong suốt\" width=\"800\" height=\"448\" srcset=\"https://vatlieuxaydunghcm.net/wp-content/uploads/2017/04/mai-lay-sang-ton-polycarbonate.jpg 800w, https://vatlieuxaydunghcm.net/wp-content/uploads/2017/04/mai-lay-sang-ton-polycarbonate-300x168.jpg 300w, https://vatlieuxaydunghcm.net/wp-content/uploads/2017/04/mai-lay-sang-ton-polycarbonate-768x430.jpg 768w\" sizes=\"(max-width: 800px) 100vw, 800px\" style=\"box-sizing: border-box; border: 0px; user-select: none; -webkit-user-drag: none; max-width: 100%; height: auto; margin-bottom: 0px;\"></p><hr style=\"height: 1px; margin: 22px 0px; border-top: 0px; background-image: linear-gradient(to right, transparent, rgba(0, 0, 0, 0.15), transparent); color: rgb(119, 119, 119); font-family: Roboto;\"><h2 style=\"box-sizing: border-box; font-family: Roboto; line-height: 1.4; color: rgb(29, 33, 39); margin: 0px 0px 0.7em; font-size: 1.4286em; letter-spacing: -1px;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 128); font-size: 17px; font-family: tahoma, arial, helvetica, sans-serif;\"><strong style=\"box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\">MÀU SẮC TÔN LẤY SÁNG POLYCARBONATE</strong></span></h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\">Tôn nhựa lấy sáng Poly cũng cho ra đời những màu sắc vô cùng đẹp và hợp với những không gian khác nhau. Chúng có 6 màu sắc khác nhau để cho chúng ta có thể chọn màu thích hợp cho công trình của mình như: màu trắng sữa, màu trong kính, màu xanh biển, màu xanh dương, màu xanh lá và màu trà đồng. Những màu sắc khác nhau sẽ có những tác dụng khác nhau ví dụ như những gam màu sẫm có thể dùng cho những nơi nắng nóng nhiều để tránh tình trạng hấp thụ nhiều ánh nắng và ngược lại những màu sáng sẽ giúp giữ nhiệt ấm hơn cho những ngày đông lạnh giá.</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto; text-align: center;\"><img class=\"alignnone wp-image-1098\" src=\"https://vatlieuxaydunghcm.net/wp-content/uploads/2017/07/ton-lay-sang-polycarbnate.jpg\" alt=\"Mẫu tôn lấy sáng Polycarbonate sóng vuông\" width=\"750\" height=\"499\" srcset=\"https://vatlieuxaydunghcm.net/wp-content/uploads/2017/07/ton-lay-sang-polycarbnate.jpg 600w, https://vatlieuxaydunghcm.net/wp-content/uploads/2017/07/ton-lay-sang-polycarbnate-300x200.jpg 300w\" sizes=\"(max-width: 750px) 100vw, 750px\" style=\"box-sizing: border-box; border: 0px; user-select: none; -webkit-user-drag: none; max-width: 100%; height: auto; margin-bottom: 0px;\"></p><h2 style=\"box-sizing: border-box; font-family: Roboto; line-height: 1.4; color: rgb(29, 33, 39); margin: 0px 0px 0.7em; font-size: 1.4286em; letter-spacing: -1px;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; font-family: tahoma, arial, helvetica, sans-serif; font-size: 17px; color: rgb(0, 0, 128);\"><span style=\"box-sizing: border-box; font-weight: 800; margin-bottom: 0px;\">ỨNG DỤNG TÔN NHỰA LẤY SÁNG POLYCARBONATE TRONG ĐỜI SỐNG</span></span></h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\">Trong cuộc sống thì tôn nhựa lấy sáng được rất nhiều người sử dụng vào các công trình khác nhau với các mục đích khác nhau, nhưng điểm chung đa số vẫn là sử dụng để lấy sáng và cách âm những nơi ở, nơi làm việc với bên ngoài để có thể có một không gian thoải mái nhất. Chúng ta có thể ứng dụng tôn nhựa lấy sáng vào các công trình như:</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\">– Ứng dụng trong xây dựng: Trong các công trình xây dựng thì tôn nhựa thường được sử dụng để làm lợp mái, lấy sáng và trang trí cho các công trình xây dựng đô thị (thương mại, văn phòng và khu liên hợp công nghiệp) chúng có thể giữ được những lượng ánh sáng cần thiết cho các khu làm việc, khu sản xuất. Cũng có thể dùng tôn nhựa để trang trí nội và ngoại thất (cửa hàng, khu triển lãm,…) hay dùng để thay thế kính tại các nhà kính công nghiệp để tránh tình trạng khi có tác động sẽ bị vỡ ra như kính gây ảnh hưởng đến con người cũng như hiệu xuất làm việc.</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\">– Ứng dụng trong phát triển đô thị : Lợp mái và che chắn cho các công trình thể dục thể thao có quy mô lớn (sân vận động, nhà thi đấu,…) sẽ tránh được lượng lớn ánh nắng mặt trời chiếu xuống sân vận động, vì thế sẽ không gây cho khan giả hay các cổ động viên cảm thấy nóng nực mà ảnh hưởng đến tâm lý cổ vũ. Hay có thể sử dụng để lợp che chắn và lấy sáng cho các công trình công cộng như nhà ga tàu hỏa, bến xe khách, trạm bán xăng, bãi đậu xe, nhà chờ xe buýt,… Trang trí cho các sân chơi, khu giải trí, công viên. Che chắn và lấy sáng cho các nối đi, hành lang trong các khu trung tâm thương mại</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; color: rgb(0, 0, 0); font-size: 17px;\">– Cho các công trình dân dụng : Đối với các công trình nhỏ hay các nhà dân, Tôn nhựa lấy sáng Polycarbonate cũng có những tác dụng nhất định như lấy sáng cho ban công, hay các ngôi nhà có kiểu dáng thiết kế theo kiểu nhà vòm sân vườn, cũng có thể dùng để lấy sáng trên cao như sân thượng, hay che chắn các giếng trời, che chắn các khu sân vườn tiểu cảnh trong nhà, hay có thể sử dụng tôn nhựa để làm những mái che chổ đâu ôtô, hổ bơi và ngoài ra tôn nhựa còn được sử dụng rộng dãi trong trong ngành quảng cáo như có thể sử dụng làm các loại hộp đèn, bảng hiệu, quảng cáo. Nội thất văn phòng, vách ngăn khu vực làm việc, ốp trần…</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 24px; color: rgb(119, 119, 119); font-family: Roboto; text-align: center;\"><img class=\"alignnone size-full wp-image-844\" src=\"https://vatlieuxaydunghcm.net/wp-content/uploads/2017/04/ton-nhua-lay-sang-soi-thuy-tinh-composite-frp-cho-nha-xuong.jpg\" alt=\"Tôn nhựa lấy ánh sáng cho nhà xưởng\" width=\"900\" height=\"508\" srcset=\"https://vatlieuxaydunghcm.net/wp-content/uploads/2017/04/ton-nhua-lay-sang-soi-thuy-tinh-composite-frp-cho-nha-xuong.jpg 900w, https://vatlieuxaydunghcm.net/wp-content/uploads/2017/04/ton-nhua-lay-sang-soi-thuy-tinh-composite-frp-cho-nha-xuong-300x169.jpg 300w, https://vatlieuxaydunghcm.net/wp-content/uploads/2017/04/ton-nhua-lay-sang-soi-thuy-tinh-composite-frp-cho-nha-xuong-768x433.jpg 768w\" sizes=\"(max-width: 900px) 100vw, 900px\" style=\"box-sizing: border-box; border: 0px; user-select: none; -webkit-user-drag: none; max-width: 100%; height: auto; margin-bottom: 0px;\"></p><h3 style=\"box-sizing: border-box; font-family: Roboto; line-height: 32px; color: rgb(29, 33, 39); margin: 0px 0px 33px; font-size: 25px; text-align: center;\"><span style=\"box-sizing: border-box; margin-bottom: 0px; font-size: 17px; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: border-box; font-weight: bold; margin-bottom: 0px;\">Tôn lấy sáng Polycarbonate cho nhà xưởng</strong></span></h3>', 'Tôn lấy sáng Polycarbonate thành công, tôn polycarbonate', '500000', '10', '40x50 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p3.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\"]', 'true', 'true', '1517979598');
INSERT INTO `sanpham` (`id`, `name`, `category`, `content`, `keyword`, `price`, `quantity`, `size`, `thick`, `image`, `status`, `hot`, `datetime`) VALUES
(10, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979774'),
(11, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984');
INSERT INTO `sanpham` (`id`, `name`, `category`, `content`, `keyword`, `price`, `quantity`, `size`, `thick`, `image`, `status`, `hot`, `datetime`) VALUES
(12, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984'),
(13, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984');
INSERT INTO `sanpham` (`id`, `name`, `category`, `content`, `keyword`, `price`, `quantity`, `size`, `thick`, `image`, `status`, `hot`, `datetime`) VALUES
(14, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984'),
(15, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984');
INSERT INTO `sanpham` (`id`, `name`, `category`, `content`, `keyword`, `price`, `quantity`, `size`, `thick`, `image`, `status`, `hot`, `datetime`) VALUES
(16, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984'),
(17, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984');
INSERT INTO `sanpham` (`id`, `name`, `category`, `content`, `keyword`, `price`, `quantity`, `size`, `thick`, `image`, `status`, `hot`, `datetime`) VALUES
(18, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984'),
(19, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984');
INSERT INTO `sanpham` (`id`, `name`, `category`, `content`, `keyword`, `price`, `quantity`, `size`, `thick`, `image`, `status`, `hot`, `datetime`) VALUES
(20, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', '', '1517979984'),
(21, 'VÁN GỖ MDF', 'Ván MDF', '                                                                     <div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_0\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Chúng ta thường thấy MDF được ứng dụng nhiều trong nghành sản xuất nội thất và được thấy nhiều nhất là ứng dụng trong <a href=\"http://mocchuan.vn/noi-that-go-van-phong/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">nội thất văn phòng</a>, kho xưởng, hay các công trình công cộng. Được xem là một dòng nguyên lệu ra đời nhằm mục đích thay thế cho gỗ tự nhiên khi mà gỗ tự nhiên ngày càng khan hiếm dần. Nó có khả năng thay thế gỗ tự nhiên hay không chúng ta cần xem xét những ưu và nhược điểm khác nhau trong mục đích sử dụng, tùy vào mục đích sử dụng khác nhau mà người ta dùng MDF để sản xuất sản phẩm cho phù hợp. Vậy <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván gỗ MDF là gì</em>? Cấu tạo của chúng ra sao và ứng dụng của chúng trong ngành nội thất gỗ là gì?</p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; text-align: justify;\">1. Khái niệm ván gỗ MDF</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Thuật ngữ MDF là viết tắt của chữ Medium density fiberboard, có nghĩa là ván sợi mật độ trung bình. Nhưng trong thực tế, MDF là tên gọi chung cho cả ba loại sản phẩm ván ép bột sợi có tỷ trọng trung bình (medium density) và độ nén chặt cao (hardboard). Để phân biệt ba loại này, người ta dựa vào thông số cơ vật lý, các thông số về độ dày và cách xử lý bề mặt của tấm ván.</p><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Xét về cấu tạo thì <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> có các thành phần cơ bản đó là: bột sợi gỗ, chất kết dính, parafin wax, chất bảo vệ gỗ (chất chống mối mọt, chống mốc), bột độn vô cơ. Còn nếu xét về cấu tạo vật lý thì MDF có những tính chất cơ lý cơ bản như sau:</div><ul style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 23px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; list-style-position: initial; list-style-image: initial; line-height: 26px; text-align: justify;\"><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Tỷ trọng ( kg/m 3)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bến uốn gãy (MOR) (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Modul uốn (MOE) ( đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền liên kết nội (đơn vị MPa)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lực giữ đinh vít ( đơn vị N)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ trương nở trong nước ( tính theo phần trăm tỷ lệ )</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ hấp thụ nước ( %)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Độ bền chịu nước (MOR,MOE của sản phẩm ngâm trong nước)</li><li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">Lượng formaldehyde thải ra (ppm)</li></ul><div style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Khi nhắc đến quy trình sản xuất <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>, sẽ có hai kiểu quy trình sản xuất để làm ra ván MDF đó là quy trình sản xuất khô và quy trình sản xuất ướt.</div><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình khô:</span> Trong quy trình này thì keo và phụ gia được phun trộn vào bột gỗ khô trong máy trộn và sấy sơ bộ. Bột sợi đã áo keo sẽ được trải ra bằng máy rải -cào thành 2-3 tầng tùy theo khổ, cỡ dày của ván đính sản xuất. Các tầng này được chuyển qua máy ép có gia nhiệt. Máy ép thực hiện ép nhiều lần ( 2 lần). Lần 1 ( ép sơ bộ) cho lớp trên, lớp thứ 2 , lớp thứ 3 Lần ép 2 là ép tiếp cả ba lớp lại. Chế độ nhiệt được thiết lập để sao cho đuổi hơi nước và làm keo hóa rắn từ từ. Sau khi ép, ván được xuất ra, cắt bỏ biên, chà nhám và phân loại.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">Quy trình ướt:</span> Với quy trình sản xuất ướt thì bột gỗ được phun nước làm ướt để kết vón thành dạng vẩy (mat formation). Chúng được cào rải ngay sau đó và được đưa lên mâm ép. Ép nhiệt một lần đến độ dày sơ bộ. Tấm ván MDF được đưa qua cán hơi ở nhiệt cao như bên làm giấy để nén chặt hai mặt và rút nước dư ra.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_0 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-1.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_1\" style=\"box-sizing: border-box; margin: 0px 0px 11.6406px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">Hình ảnh bột gỗ nghiền mịn trước khi trộn keo ép thành <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván MDF</span></span></p><h2 style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; background: 0px 0px; font-size: 26px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(51, 51, 51); line-height: 1em; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\">2. Ván gỗ MDF có tốt không, ứng dụng thực tế vào đâu?</h2><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tùy theo chủng loại gỗ làm ra bột gỗ và chất kết dính cũng như các phụ gia mà chúng ta có thể sử dụng chúng vào việc sản xuất các đồ dùng nội thất gia đình và văn phòng, kho xưởng, trường học, bệnh viện…Nếu MDF được làm từ sợi composite pha phụ gia chống ẩm thì có thể dùng dùng cho một số yêu cầu ngoài trời, nơi ẩm ướt hay làm <a href=\"http://mocchuan.vn/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">cửa gỗ</a>công nghiệp, hoăc dùng cốt để tiếp tục dán ván lạng veneer lên hay hoặc trang trí bằng cách phủ melamine lên bề mặt.</p></div></div><div class=\"et_pb_module et_pb_image et_pb_image_1 et_always_center_on_mobile\" style=\"box-sizing: border-box; margin: 0px auto 11.6406px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; line-height: 0; animation-timing-function: linear; animation-duration: 0.2s; color: rgb(102, 102, 102); font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif;\"><span class=\"et_pb_image_wrap\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; display: inline-block; position: relative; max-width: 100%;\"><img src=\"http://mocchuan.vn/wp-content/uploads/van-mdf-la-gi-3.jpg\" alt=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; max-width: 100%; height: auto; position: relative;\"></span></div><div class=\"et_pb_text et_pb_module et_pb_bg_layout_light et_pb_text_align_left  et_pb_text_2\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: center center; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; word-wrap: break-word; animation-timing-function: linear; animation-duration: 0.2s; font-family: \"Noticia Text\", Georgia, \"Times New Roman\", serif; color: rgb(102, 102, 102);\"><div class=\"et_pb_text_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; position: relative;\"><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: center;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(0, 0, 255);\">MDF dùng cho nội thất văn phòng nhiều nhất vì chi phí sản xuất khá rẻ</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Còn trong nội thất gia đình hầu như chúng chỉ dành cho các đối tượng khách hàng muốn tiết kiệm chi phí khi mà các sản phẩm đóng từ gỗ tự nhiên khá cao. Bạn có thể mua 1 chiếc<a href=\"http://mocchuan.vn/tu-bep-go-soi-my/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\"> tủ bếp gỗ sồi</a> giá 30 triệu đến 40 triệu nhưng với MDF thì chỉ bằng 1/2 giá đó. Được xem là sản phẩm có cấu tạo ảnh hưởng khá lớn bởi hóa chất công nghiệp, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span>được <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; color: rgb(255, 0, 0);\">cân nhắc có nên sử dụng hay không</span> vì nó ảnh hưởng đến sức khỏe con người. Hiện nay, từ các nghiên cứu về ván MDF cho thấy, sự thải ra <a href=\"http://mocchuan.vn/tac-hai-cua-formaldehyde-trong-van-cong-nghiep-mdf-hdf/\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">formaldehyde</a> của <em style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%;\">ván MDF</em> trong qua trình sản xuất và ngay cả khi sử dụng là rất cao. Formaldehyde gây ảnhh hưởng nghiêm trọng đến người trực tiếp sản xuất ra chúng và những khách hàng sử dụng khi tiếp xúc lâu dài.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Tất nhiên MDF ra đời đều được nghiên cứu và trải qua nhiều quá trình thử nghiệm và chúng có ích mới được sử dụng. Việc thải ra các chất độc hầu như chỉ thấy ở các đơn vị sản xuất nhỏ lẻ, kém chất lượng, không có quy trình QC đúng chuẩn. Chính vì lẽ đó, pháp luật của các nước phương Tây như Mỹ, Canada, Anh, Hungary… bắt buộc các nhà sản xuất đồ gỗ nội thất khi bán các sản phẩm đóng từ MDF qua nước mình từ các nước châu Á như Trung quốc, Thái Lan trong đó có Việt Nam phải cam kết dùng các loại MDF thải ra formaldehyde rất ít dưới 0.02% vào đầu năm 2009 và hoàn toàn không có formaldehyde vào 2010. Điều này đưa đến cuộc chạy đua nước rút trong nghiên cúu sản xuất MDF không formaldehyde.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; text-align: justify;\">Là đơn vị chuyên <a href=\"http://mocchuan.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; color: rgb(102, 102, 102);\">thi công nội thất gỗ</a> chuyên nghiệp, Mộc Chuẩn vẫn thường xuyên sử dụng <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: 0px 0px; vertical-align: baseline; text-size-adjust: 100%; font-weight: 700;\">ván gỗ MDF</span> để đóng các đồ nội thất trong đó nhiều nhất vẫn là nội thất văn phòng, kho xưởng, bệnh viện, trường học…tùy theo yêu cầu đặt hàng từ phía khách hàng. Ngoài ra không ít các khách hàng là hộ gia đình vẫn liên hệ đặt hàng nội thất đóng từ MDF. Một điều tiên quyết là chúng tôi nói không với hàng Trung Quốc hoặc hàng trôi nổi, chỉ sử dụng MDF nguyên liệu mua từ các đơn vị sản xuất hoặc phân phối có uy tín, dù giá thành có cao một chút nhưng bù lại sản phẩm luôn có bề mặt căng đẹp, các hàm lượng hóa chất nằm trong giới hạn cho phép không những bảo vệ khách hàng mà còn bảo vệ cho chính các nhân viên trực tiếp gia công khi mà hằng ngày họ đều tiếp xúc với bụi gỗ.</p></div></div>                                                      ', 'ván MDF, ván gỗ, gỗ ghép, mdf', '250000', '50', '100x200 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p2.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p7.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p18.jpg\"]', 'true', 'true', '1517979984');
