 auto; width: auto;\"><figcaption class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Bề mặt Melamine</figcaption></figure><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">2.    Thành phần cấu tạo</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– Giấy trang trí phủ Melamine thực chất là một loại giấy nền được tạo vân, tạo màu sắc sau đó được nhúng qua keo và phủ một lớp Melamine lên trên cùng.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Giấy nền có thành phần chính là: Bột gỗ, Titan và các chất khác.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Melamine</span> là một bazơ hữu cơ ít tan trong nước và có công thức hóa học là C3H6N6.</p><figure id=\"attachment_1840\" class=\"wp-caption aligncenter\" style=\"box-sizing: border-box; margin: 5px auto; padding: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; max-width: 900px; text-align: center; width: auto; clear: both; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><img class=\"size-full wp-image-1840\" src=\"https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine.png\" alt=\"Giấy Melamine\" width=\"900\" height=\"600\" srcset=\"https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine.png 900w, https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine-300x200.png 300w, https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine-768x512.png 768w, https://gominhlong.com/wp-content/uploads/2017/05/Giay-Melamine-600x400.png 600w\" sizes=\"(max-width: 900px) 100vw, 900px\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border-width: 0px; border-color: initial; border-image: initial; max-width: 100%; height: auto; width: auto;\"><figcaption class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Giấy Melamine</figcaption></figure><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">3.    Sản xuất</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– Trước hết, giấy nền được tạo vân và tạo màu sắc.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Sau đó, giấy được nhúng keo và phủ <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Melamine</span>.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Cuối cùng, giấy được sấy khô và cắt thành khổ quy định.</p><figure id=\"attachment_1842\" class=\"wp-caption aligncenter\" style=\"box-sizing: border-box; margin: 5px auto; padding: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; max-width: 900px; text-align: center; width: auto; clear: both; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><img class=\"wp-image-1842 size-full\" src=\"https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long.png\" alt=\"Giấy Melamine chuẩn bị được đưa vào quy trình ép\" width=\"900\" height=\"600\" srcset=\"https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long.png 900w, https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long-300x200.png 300w, https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long-768x512.png 768w, https://gominhlong.com/wp-content/uploads/2017/05/Melamine-Minh-Long-600x400.png 600w\" sizes=\"(max-width: 900px) 100vw, 900px\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border-width: 0px; border-color: initial; border-image: initial; max-width: 100%; height: auto; width: auto;\"><figcaption class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Giấy Melamine chuẩn bị được đưa vào quy trình ép</figcaption></figure><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">4.    Ưu điểm</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– Màu sắc phong phú.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Bề mặt đa dạng.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Bền màu, bề mặt khó trầy xước.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Quá trình gia công bề mặt đơn giản và nhanh.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Giấy trang trí phủ <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Melamine</span> có giá thành hợp lý.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">5.    Nhược điểm</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– So với các bề mặt khác như Laminate hay Acrylic, giấy trang trí phủ Melamine có hạn chế về tạo dáng hơn.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">– Bề mặt chịu xước, chịu mài mòn và chịu va đập kém hơn bề mặt Laminate.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">6.    Ứng dụng</span></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\">– Thông thường, giấy trang trí phủ <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Melamine</span> được ép lên các tấm vật liệu như ván dăm hay ván MDF để ứng dụng trong sản xuất nội thất như bàn ghế, giường tủ, vách ngăn, vân vân.</p>                                    ', 'gỗ MFC, mfc, ván mfc, trang trí', '350000', '30', '20x30 m', '30mm', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p30.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p10.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p9.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p27.jpg\"]', 'true', '', '1517980319'),
(24, 'GỖ MFC – VÁN DĂM PHỦ MELAMINE', 'Cemboard - Prima - Shara', '                                              <p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Ván MFC</span> gồm 2 thành phần: ván dăm phủ giấy Melamine. Ván dăm có độ cứng chắc, khả năng bám vít tốt, kết hợp giấy Melamine cho khả năng chống ẩm, chống xước hiệu quả.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><a href=\"https://gominhlong.com/san-pham/tam-vat-lieu-phu-melamine/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(51, 122, 183);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">Gỗ MFC</span></a> là sản phẩm được nhiều khách hàng tín nhiệm ưa dùng.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; clear: both;\">Bên cạnh MFC, <span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-weight: 700; line-height: 25px;\">giấy Melamine</span> còn phủ trên bề mặt ván MDF, ván dán …</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: left; width: 804px; font-size: 16px; color: rgb(47, 47, 47); font-family: Arial, sans-serif;\"><em style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Tìm hiểu thêm về gỗ MFC <a href=\"https://gominhlong.com/gioi-thieu-san-pham-van-go-cong-nghiep-mfc/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(51, 122, 183);\">tại đây</a>.</em></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; float: