(34, 'Ván Okan – ván okal', 'Ván Okal', '<p style=\"margin: 13px 0px; padding: 0px; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.8);\"><a title=\"Ván Okan\" href=\"http://vanepducphat.com/van-okan\" style=\"transition: all 0.5s ease 0s; margin: 0px; padding: 0px; line-height: 22.75px; color: rgb(19, 229, 0);\">Ván Okan</a>&nbsp;(<a title=\"ván okal\" href=\"http://vanepducphat.com/van-okan\" style=\"transition: all 0.5s ease 0s; margin: 0px; padding: 0px; line-height: 22.75px; color: rgb(19, 229, 0);\">ván okal</a>)hay còn goi là Ván dăm (PB) là gỗ nhân tạo được sản xuất từ nguyên liệu gỗ rừng trồng (bạch đàn, keo, cao su…), có độ bền cơ lý cao, kích thước bề mặt rộng, phong phú về chủng loại. . Ván dăm được sản xuất bằng quá trình ép dăm gỗ đã trộn keo, tương tự như MDF nhưng gỗ được xay thành dăm, nên chúng có chất lượng kém hơn ván sợi.</p><div id=\"attachment_46\" class=\"wp-caption aligncenter\" style=\"margin: 10px auto; border: 1px solid rgb(221, 221, 221); background-color: rgb(243, 243, 243); padding-top: 4px; text-align: center; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; width: 310px;\"><a href=\"http://vanepducphat.com/wp-content/uploads/2014/10/van-okan.jpg\" rel=\"lightbox[45]\" style=\"transition: all 0.5s ease 0s; margin: 0px; padding: 0px; line-height: 22.75px; color: rgb(19, 229, 0);\"><img class=\"wp-image-46 size-medium\" src=\"http://vanepducphat.com/wp-content/uploads/2014/10/van-okan-300x261.jpg\" alt=\"ván okan\" width=\"300\" height=\"261\" srcset=\"http://vanepducphat.com/wp-content/uploads/2014/10/van-okan-300x261.jpg 300w, http://vanepducphat.com/wp-content/uploads/2014/10/van-okan.jpg 395w\" sizes=\"(max-width: 300px) 100vw, 300px\" style=\"border-width: 0px; border-color: initial; border-image: initial; margin: 0px auto; display: block; padding: 0px; max-width: 683px !important;\"></a><p class=\"wp-caption-text\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 4px 5px; font-size: 11px; line-height: 17px;\">ván okan</p></div><p style=\"margin: 13px 0px; padding: 0px; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.8);\">Cốt Ván dăm chủ yếu được phủ nhựa Melamine (MFC) tạo thành nguyên liệu phục vụ trong lĩnh vực nội thất văn phòng.</p><p style=\"margin: 13px 0px; padding: 0px; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.8);\">ván okal – Ván dăm thao tác trên máy cũng như bắt đinh ốc đều tốt. Đặc biệt do giá rẻ hơn nguyên liệu gỗ đặc nên ván dăm được sử dụng phổ biến.</p><p style=\"margin: 13px 0px; padding: 0px; color: rgb(9, 102, 0); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 13px; background-color: rgba(255, 255, 255, 0.8);\">Với bề mặt phẳng, rắn chắc, đồng nhất, bề mặt ván dăm là lựa chọn lí tưởng cho những gia công ứng dụng như phủ veneer, dán keo dưới lực ép cao hay thấp, phủ melamine, phủ giấy, dán vinyl, in trực tiếp, và phủ coating. Các chất nền có giá thành kinh tế và các cách phủ mặt trang trí cung cấp cho khách hàng nhiều lựa chọn và làm cho ván dăm có vị trí cạnh tranh trên thị trường nguyên liệu gỗ.</p>', 'ván okal, ván okan, ván ép', '200000', '21', '40x60 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p6.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p8.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p16.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p24.jpg\"]', 'true', '', '1517980691');
