(53, 'Tấm  veneer', 'Tấm Veneer', '                                              <p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Nếu cây gỗ dày 300mm và rộng 200mm dài 2500mm thì sẽ lạng ra khoảng 1500 – 3000m2 gỗ veneer, tùy từng loại hao hụt Sau khi được lạng, gỗ veneer được dán vào các loại cốt gỗ công nghiệp khác nhau như gỗ MDF, gỗ Ván dán, gỗ figer, gỗ ván dăm, để làm ra các sản phẩm nội thất. Do lạng từ cây gỗ tự nhiên nên bề mặt gỗ veneer không khác gì gỗ tự nhiên cả.<br style=\"box-sizing: border-box;\">Những năm trở lại đây, gỗ tự nhiên đã dần dần cạt kiệt bởi sự khai thác, tàn phá của con người, các sản phẩm khác bắt đầu xuất hiện và thay thế gỗ tự nhiên một cách hoàn hảo, nổi bật hơn cả đó là gỗ Veneer, vậy veneer và gỗ tự nhiên khác nhau như thế nào?</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\"><img title=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" alt=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" class=\"aligncenter lazyloaded\" src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/wood_viet_nam.jpg\" data-lazy-src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/wood_viet_nam.jpg\" width=\"382\" height=\"273\" data-was-processed=\"true\" style=\"box-sizing: border-box; border: 0px; display: block; margin: 5px auto; max-width: 100%;\"></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px;\">Gỗ tự nhiên: là loại gỗ thịt được xẻ ra từ cây gỗ trong rừng và về chế biến thành gỗ tự nhiên, gỗ tự nhiên sau khi ngâm tẩm sấy có thể làm các loại sản phẩm<span style=\"box-sizing: border-box; font-weight: 700;\"><em style=\"box-sizing: border-box;\"><a title=\"Noi that dep\" href=\"http://noithatducduong.com/\" target=\"_blank\" style=\"box-sizing: border-box; color: rgb(138, 109, 59); font-size: 14px;\"> nội thất</a></em></span> theo yêu cầu. gỗ tự nhiên đã ăn sâu vào tiềm thức của người dân Việt Nam mình nên hầu như ai trong chúng ta đều biết cả. Ưu điểm của gỗ tự nhiên là chắc chắn, bền và đẹp. tuy nhiên nhược điểm<span style=\"box-sizing: border-box; font-weight: 700;\"> <a title=\"Cửa gỗ tự nhiên\" href=\"http://noithatducduong.com/products/cua-go-tu-nhien/\" target=\"_blank\" style=\"box-sizing: border-box; color: rgb(138, 109, 59); font-size: 14px;\">của gỗ tự nhiên</a></span> cũng nhiều như, giá cả rất cao, hay bị cong vênh, mối mọt, nứt toác nếu không có quy trình ngâm tẩm sấy tốt. Tiếp nữa là nguồn gỗ ngày càng cạt kiệt thì gỗ tự nhiên ngày càng hiếm, việc dùng gỗ tự nhiên nhiều sẽ hủy hoại môi trường sinh thái và làm gia tăng nhiệt độ của trái đất.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\"><img title=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" alt=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" class=\"aligncenter lazyloaded\" src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/Veneer_2.jpg\" data-lazy-src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/Veneer_2.jpg\" width=\"400\" height=\"300\" data-was-processed=\"true\" style=\"box-sizing: border-box; border: 0px; display: block; margin: 5px auto; max-width: 100%;\"></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Gỗ Veneer: Nói nôm na cho mọi người dễ hiểu, gỗ veneer chính là gỗ tự nhiên, tuy nhiên được lạng mỏng từ cây gỗ tự nhiên, gỗ veneer chỉ dày từ 1Rem cho đến 2ly là nhiều, một cây gỗ tự nhiên nếu lạng mỏng ra thì được rất nhiều gỗ veneer. Nếu cây gỗ dày 300mm và rộng 200mm dài 2500mm thì sẽ lạng ra khoảng 1500 – 3000m2 gỗ veneer, tùy từng loại hao hụt. Sau khi được lạng, gỗ veneer được dán vào các loại cốt gỗ công nghiệp khác nhau như gỗ MDF, gỗ Ván dán, gỗ figer, gỗ ván dăm, để làm ra các sản phẩm nội thất. Do lạng từ cây gỗ tự nhiên nên bề mặt gỗ veneer không khác gì gỗ tự nhiên cả.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Ưu điểm của gỗ Veneer: Giá thành rẻ hợp lý, một cây gỗ tự nhiên khi lạng ra thành gỗ veneer có thể sản xuất ra rất nhiều bàn ghế..gỗ veneer chống cong vênh, mối mọt và có bề mặt sáng ( do được chọn gỗ), có thể ghép trang trí vân chéo, vân ngang, vân dọc, đảo vân, có thể chạy chỉ chìm, tùy loại… mà vẫn giữ được nét đẹp và hiện đại của mình. Nếu sử dụng cốt gỗ Finger ( tức là cốt gỗ thịt tuy nhiên được xẻ ra từ các cành cây nhỏ ghép đan chéo tay nhau (finger- ngón tay) để tạo độ dài, rộng.) thì gỗ veneer lại biến thành gỗ tự nhiên hoàn toàn và rất bền, chắc chắn, đẹp mà giá thành lại rẻ.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\"><img title=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" alt=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" class=\"aligncenter lazyloaded\" src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/20110811095935_tu-bep1.jpg\" data-lazy-src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/20110811095935_tu-bep1.jpg\" width=\"480\" height=\"270\" data-was-processed=\"true\" style=\"box-sizing: border-box; border: 0px; display: block; margin: 5px auto; max-width: 100%;\"></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Nhược điểm gỗ veneer:</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Do cốt gỗ là gỗ công nghiệp nên gỗ veneer không chịu được nước, dễ bị sứt, nếu di chuyển nhiều khi đã lên thành thành phẩm thì hay bị hư hỏng, rạn nứt, chính vì vậy gỗ veneer là được nhiều người dùng tuy nhiên phải ở nhưng nơi quanh năm không bị nước tràn vào, và ít phải di chuyển. Ở các nước hiện đại như Châu Âu, châu Mỹ, hoặc một vài nước hiện đại ở châu Á, việc dùng gỗ veneer vào chế tạo các sản phẩm nội thất đã có từ cách đây 30-40 năm, khi họ ý thức được rừng ngày cạn kiệt, họ thấy rằng gỗ veneer có rất nhiều ưu điểm vượt trội mà lại cứu được môi trường sống của họ, cứu được sạt lở đất và sự nóng lên của trái đất nên họ chuyển sang dùng nhiều, vậy tại sao chúng ta lại không làm theo họ, chúng ta đừng nên hủy hoại chính môi trường sống của chúng ta. Nắm bắt được thị hiếu vô cùng lớn của thị trường trong thế kỷ 21.</p><div><br></div>                                    ', 'tấm veneer, nhập khẩu, veneer', '400000', '10', '50x50 m', '', '[\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p3.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p1.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p6.jpg\",\"http:\\/\\/localhost\\/shop3tr\\/files\\/sanpham\\/p8.jpg\"]', 'true', '', '1517980812'),
