(55, 'Tấm  veneer', 'Tấm Veneer', '                                              <p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Nếu cây gỗ dày 300mm và rộng 200mm dài 2500mm thì sẽ lạng ra khoảng 1500 – 3000m2 gỗ veneer, tùy từng loại hao hụt Sau khi được lạng, gỗ veneer được dán vào các loại cốt gỗ công nghiệp khác nhau như gỗ MDF, gỗ Ván dán, gỗ figer, gỗ ván dăm, để làm ra các sản phẩm nội thất. Do lạng từ cây gỗ tự nhiên nên bề mặt gỗ veneer không khác gì gỗ tự nhiên cả.<br style=\"box-sizing: border-box;\">Những năm trở lại đây, gỗ tự nhiên đã dần dần cạt kiệt bởi sự khai thác, tàn phá của con người, các sản phẩm khác bắt đầu xuất hiện và thay thế gỗ tự nhiên một cách hoàn hảo, nổi bật hơn cả đó là gỗ Veneer, vậy veneer và gỗ tự nhiên khác nhau như thế nào?</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\"><img title=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" alt=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" class=\"aligncenter lazyloaded\" src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/wood_viet_nam.jpg\" data-lazy-src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/wood_viet_nam.jpg\" width=\"382\" height=\"273\" data-was-processed=\"true\" style=\"box-sizing: border-box; border: 0px; display: block; margin: 5px auto; max-width: 100%;\"></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px;\">Gỗ tự nhiên: là loại gỗ thịt được xẻ ra từ cây gỗ trong rừng và về chế biến thành gỗ tự nhiên, gỗ tự nhiên sau khi ngâm tẩm sấy có thể làm các loại sản phẩm<span style=\"box-sizing: border-box; font-weight: 700;\"><em style=\"box-sizing: border-box;\"><a title=\"Noi that dep\" href=\"http://noithatducduong.com/\" target=\"_blank\" style=\"box-sizing: border-box; color: rgb(138, 109, 59); font-size: 14px;\"> nội thất</a></em></span> theo yêu cầu. gỗ tự nhiên đã ăn sâu vào tiềm thức của người dân Việt Nam mình nên hầu như ai trong chúng ta đều biết cả. Ưu điểm của gỗ tự nhiên là chắc chắn, bền và đẹp. tuy nhiên nhược điểm<span style=\"box-sizing: border-box; font-weight: 700;\"> <a title=\"Cửa gỗ tự nhiên\" href=\"http://noithatducduong.com/products/cua-go-tu-nhien/\" target=\"_blank\" style=\"box-sizing: border-box; color: rgb(138, 109, 59); font-size: 14px;\">của gỗ tự nhiên</a></span> cũng nhiều như, giá cả rất cao, hay bị cong vênh, mối mọt, nứt toác nếu không có quy trình ngâm tẩm sấy tốt. Tiếp nữa là nguồn gỗ ngày càng cạt kiệt thì gỗ tự nhiên ngày càng hiếm, việc dùng gỗ tự nhiên nhiều sẽ hủy hoại môi trường sinh thái và làm gia tăng nhiệt độ của trái đất.</p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\"><img title=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" alt=\"Gỗ Verneer là gì, sự khác nhau giữa gỗ veneer và gỗ tự nhiên\" class=\"aligncenter lazyloaded\" src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/Veneer_2.jpg\" data-lazy-src=\"http://noithatducduong.com/wp-content/uploads/tin_bai/Veneer_2.jpg\" width=\"400\" height=\"300\" data-was-processed=\"true\" style=\"box-sizing: border-box; border: 0px; display: block; margin: 5px auto; max-width: 100%;\"></p><p style=\"box-sizing: border-box; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(71, 71, 71); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 16px; text-align: justify;\">Gỗ Ve